import React from "react";
import style from "./nav.module.css";

menu = ["Home", "About", "skill", "Education"];

const Nav = () => {
  return (
    <div className="container bg-primary">
      <nav>
        <div className={style.navLeft}>
          <p>Name</p>
        </div>
        <div className={style.navRight}></div>
      </nav>
    </div>
  );
};

export default Nav;
